import React from 'react';
import './App.css';


function App() {
  const categories = ['Channels','asdfasdf'];
  return (
    <>
      <SearchBar/>
      <CategoryList categories={categories} />
      <Box title="Ttile" description="descs" tags={["asdf", "asdfasd"]}></Box>
    </>
  );
}

export default App;
